INSERT [dbo].[Artistas] ([ID], [varbImagen], [nvarchImageMimeType], [nvarchNombre], [nvarchPais], [intAño], [IDGenero], [nvarchBiografia]) VALUES (1, , N'image/jpeg', N'The Beatles', N'Inglaterra', 1960, 5, N'La banda se formó alrededor de Lennon (John Winston Lennon, nacido el 9 de octubre de 1940 en Woolton, Liverpool, Gran Bretaña) y McCartney (James Paul McCartney 18 de junio de 1940 también en Livepool) en julio de 1957 cuando ambos coincidieron en The Quarry Men, un grupo Skiffle (estilo musical derivado del folk, muy popular en la América de los años 20 y que se tocaba con instrumentos rudimentarios y guitarras acústicas) y con el que intentaban potenciar el sonido clásico del Rock norteamericano de esa década encarnado para ellos en Buddy Holly. El debut de Paul en la banda se produjo en octubre de ese mismo año en el New Clubmoor Hall Conservative de Norris Green en Liverpool. En agosto de 1958 George Harrison (nacido el 24 de febrero de 1943 en Wavertree, Liverpool a las 23 h. y 42'' y no como se creía el 25 de febrero, lo contaba en 1993 en la fiesta de su 40 cumpleaños) se unió a la banda gracias a Paul, compañero de escuela años atrás. Ese mismo mes grabaron su primera maqueta que contenía una versión de "That''ll Be The Day" de Buddy Holly y un tema firmado por Harrison/McCartney, "In Spite Of All The Danger".  En enero de 1960, Stuart Sutcliffe (nacido el 23 de junio de 1940 en Edimburgo, Escocia), un joven pintor amigo de Lennon en la Escuela de Bellas Artes, se sumó a la banda como bajista. En agosto de ese mismo año llegaría por fin un batería, Pete Best (Randolph Peter Best, nacido en Madrás, India, el 24 de noviembre de 1941). El 17 de agosto el grupo viajó a Hamburgo (Alemania) como The Beatles, y allí se fraguó la leyenda con mas de 120 noches consecutivas tocando en directo por diferentes clubes (Indra y Kaiserkeller).  El 21 de febrero de 1961 The Beatles debutaron en el mítico Cavern Club de Liverpool. En abril regresaron a Hamburgo donde grabaron con Tony Sheridan como The Beat Brothers (aconsejados por un amigo alemán que les dijo que The Beatles no era comercial). En octubre, de nuevo en Liverpool, coincidieron con Gerry & The Pacemakers y decidieron combinar fuerzas como The Beatmakers. Brian Epstein, cazatalentos y gerente de una tienda de discos, se interesó por ellos tras tanto movimiento y finalmente, en noviembre, Epstein pudo ver a la banda por primera vez en The Cavern.  En enero de 1962, Epstein firmó un precontrato como mánager de la banda. En marzo de ese mismo año The Beatles aparecieron por primera vez en la BBC Radio en un programa juvenil llamado Here We Go; sería la primera de una serie de entrevistas, especiales y grabaciones que tendrían en la emisora británica a través de los años.  Stuart Sutcliffe, que aun vivía en Alemania, falleció el 10 de abril de 1962 a causa de un derrame cerebral de camino al hospital en los brazos de su novia Astrid Kirchherr (la primera persona en hacer fotografías de The Beatles y sugerir el corte de pelo que los haría mundialmente conocidos).  El 9 de mayo, y tras muchas gestiones de Epstein, la banda se encontró por primera vez con quien sería su productor, y para muchos el quinto Beatle, George Martin (nacido el 3 de enero de 1926 en Londres) quien consiguió que la banda firmase un contrato provisional con Parlophone (EMI) para grabar una serie de maquetas. El 6 de junio entraron por primera vez en los estudios Abbey Road bajo la dirección de Ron Richards (asistente de producción de George Martin). Registraron cuatro temas: "Bésame mucho" y tres composiciones propias "P.S. I Love You", "Ask Me Why" y "Love Me Do".  En el verano de 1962, Epstein, Lennon, McCartney y Harrison tomaron la decisión de sustituir a Best como batería. El 18 de agosto debutó en el grupo el antiguo batería de Rory Storm & The Hurricanes, Ringo Starr (Richard Starkey, nacido en Dingle, Liverpool, el 7 de julio de 1940). Pocos días después John Lennon se casó con Cynthia Powell, su primera esposa. Lennon pasó la noche de bodas tocando con sus compañeros en el Riverpark Ballroom.  El 5 de octubre de 1962 se editó el primer single de The Beatles, "Love Me Do", que fue grabado entre el 4 y el 11 de septiembre en una serie de sesiones donde también se terminaron, por una parte, la edición definitiva de "P.S. I Love You" y una primitiva versión de "Please Please Me". En dichas sesiones debutó Ringo, pero sólo tocando percusiones y maracas puesto que George Martin ya había contratado a un músico de sesión (Andy White) para dicha grabación. El escaso entusiasmo de las emisoras de radio anglosajonas llevó a Brian Epstein a pedir para su compañía 10.000 ejemplares del single y comenzó una campaña de acoso a través de postales y peticiones que finalmente provocó se escuchase el disco en la BBC y en Radio Luxemburgo. A finales de diciembre de ese año la canción ocupaba el puesto nº 17 en la lista de éxitos británica.  En enero de 1963, The Beatles comenzaron su primera gran gira en Escocia a la que siguió a final del mes la primera gran gira nacional junto a la joven estrella Helen Shapiro. En dicho tour tuvieron noticias de su primer gran éxito en listas británicas: "Please Please Me" conseguía llegar al nº 2. Lo que le sigue a esta mítica banda es historia y The Beatles siempre será una banda que marcó un antes y después impactando lo que es la música en el mundo.')
GO
INSERT [dbo].[Artistas] ([ID], [varbImagen], [nvarchImageMimeType], [nvarchNombre], [nvarchPais], [intAño], [IDGenero], [nvarchBiografia]) VALUES (2, , N'image/jpeg', N'Deep Purple', N'Inglaterra', 1968, 6, N'Deep Purple es una agrupación de Hard Rock que se formó a inicios de 1968 en Londres, Inglaterra.  Al principio el grupo adoptó el nombre de "Roundabout". La banda estaba formada por Chris Curtis, Jon Lord, Ritchie Blackmore, Dave Curtis y Bobby Woodman. Al poco tiempo de su creación, una serie de problemas internos comenzaron a darse, y la banda se desintegra, quedando como únicos integrantes Lord y Blackmore.  Posteriormente se incorpora el bajista Nick Simper, el vocalista Rod Evans, y el batería Ian Paice. Es así como la nueva alineación se divide de la siguiente manera: Rod Evans en la primera voz, Ritchie Blackmore en la guitarra, Jon Lord en los teclados, Nick Simper en el bajo e Ian Paice en batería.  Poco tiempo después firman un contrato con la discográfica Tetragrammation (EEUU, Canadá y Japón), y con EMI para cubrir Europa. A partir de ese momento pasan a llamarse "Deep Purple".   Ese mismo año aparece su álbum debut, "Shades of Deep Purple",del que se extrae el sencillo "Hush", con el que lograron ingresar al cuarto puesto de las listas americanas. La acogida que recibió Deep Purple por parte del público fue tal, que casi inmediatamente se embarcaron en una gira a lo largo de todo Estados Unidos.  Para 1969 lanzan su segundo disco, titulado "The Book of Taliesyn", y meses más tarde aparece el disco homónimo "Deep Purple".  Para aquél entonces, ocurren nuevos problemas al interior de Deep Purple. Por ello Evans y Simper se alejan del grupo e ingresan Ian Gillan como vocalista y el bajista Roger Glover.  Iniciando la década de los 70, publican el álbum "In Rock", también ese mismo año aparecen dos discos en vivo. Por un lado "Concerto for Group and Orchestra", el cual fue grabado durante una presentación del conjunto en el Royal Albert Hall de Londres en 1969, y por el otro, "Gemini Suite Live" grabado en el Royal Festival Hall de Londres junto a la Orchestra of the Light Music Society.  En 1971 sale a la venta el LP "Fireball". Con este LP, Deep Purple logró acercarse al Top 40 de USA, y al número uno en Gran Bretaña. A fines de ese año, la banda crea su propia compañía discográfica bajo el nombre de "Purple Records".  "Machine Head", su disco con mayor éxito comercial sale al mercado en 1972. De este álbum se extraen los conocidos temas "Lazy", "Highway Star" y "Smoke on the Water".  Un año después Deep Purple edita el disco en vivo "Made in Japan", el cual precisamente fue grabado durante una de las presentaciones del grupo en Japón. Cabe destacar que esta producción se convirtió en "el álbum en vivo más vendido en la historia de la música". También ese año aparece el disco grabado en estudio "Who Do We Think We Are" (1973). Al poco tiempo, Ian Gillan abandona Deep Purple, al igual que Roger Glover. En sus puestos ingresan David Coverdale como vocalista y Glenn Hughes como bajista.   En 1974 presentan el disco "Burn" en donde aparecen los temas "Burn", "Mistreated" y "You fool No One". Meses más tarde, Deep Purple publica el LP "Stormbringer".  La banda tuvo una gran serie de modificaciones en los integrantes de ella pero actualmente la formación sólida que tiene Purple es: Ian Gillan en vocales,  Steve Morse en guitarra, Roger Glover en el bajo, Don Airey con el órgano y Ian Paice en la batería.')
GO
INSERT [dbo].[Artistas] ([ID], [varbImagen], [nvarchImageMimeType], [nvarchNombre], [nvarchPais], [intAño], [IDGenero], [nvarchBiografia]) VALUES (3, , N'image/jpeg', N'Ramones', N'Estados Unidos', 1974, 7, N'Grupo estadounidense de punk-rock formado por el cantante Joey Ramone (Jeffrey Hyman, 1952 - 2001), el bajista Dee Dee Ramone (Douglas Colvin, 1952 - 2002), el guitarrista Johnny Ramone (John Cummings, 1948 - 2004) y el batería húngaro Tommy Ramone (Tom Erdelyi, 1952), que sería substituido en 1978 por el percusionista Marky Ramone (Marc Bell, 1956). Creada en 1974 en el distrito neoyorquino de Queens, The Ramones fue, junto a The Sex Pistols y The Clash, una de las bandas centrales del movimiento punk. Con su música áspera y sin ornamentos, alcanzó pronto la categoría de grupo de culto dentro del punk. Muchas canciones de The Ramones, como Sheena is a Punk Rocker y Rockaway Beach, se convirtieron en himnos del movimiento.  En 1976, tras actuar en el mítico local neoyorquino CBGB''s, ficharon por la discográfica Sire Records y lanzaron su álbum de debut, Ramones, que incluía ya temas destinados a convertirse en clásicos de la época, como Blitzkrieg Bop. Sus espectaculares y rotundas actuaciones en directo los llevaron a triunfar también en el Reino Unido, donde su segundo álbum, Ramones Leave Home (1976), entró en el top cincuenta de las listas, al igual que otro clásico de la banda, el single Sheena is a Punk Rocker. Los siguientes trabajos, Rocket to Russia (1977) y Road to Ruin (1978), se mantuvieron en la línea inicial del grupo y alcanzaron cifras de ventas similares.  En 1981 contrataron para la edición de su álbum End of the Century al reputado productor Phil Spector, uno más importantes de la música rock. Este álbum sería recordado más tarde por el propio grupo como el peor trabajo de su trayectoria; su tema Baby I love you, sin embargo, llegó al puesto número ocho en las listas británicas. A partir de entonces las ventas descendieron considerablemente, hecho que propició que Marky Ramone abandonase la banda y fuera reemplazado por Richard Beau, el segundo Ritchie Ramone. Esto ocurrió en 1983, después de editar el álbum Subterranean Jungle; ese mismo año, Joey hubo de ser intervenido con urgencia en la cabeza tras una pelea. The Ramones siguieron estando en activo en las décadas de 1980 y 1990; durante esos años lanzaron un total de quince álbumes. En 1985 se pasaron a la discográfica británica Beggars Banquet, sello con el que editaron temas como Somebody put something in my drink. En 1988 se editó Ramones Mania, álbum recopilatorio que parecía presagiar su disolución. Publicaron todavía Mondo Bizarro (1992) y Acid Eaters (1994) y cerraron su carrera discográfica en el año 1995 con el álbum ¡Adiós Amigos! Un año después darían su último concierto. En la década siguiente la desdicha pareció cebarse con los ex Ramones: en cuatro años perdieron la vida tres de los cuatro miembros del grupo.')
GO
INSERT [dbo].[Artistas] ([ID], [varbImagen], [nvarchImageMimeType], [nvarchNombre], [nvarchPais], [intAño], [IDGenero], [nvarchBiografia]) VALUES (4, , N'image/jpeg', N'Judas Priest', N'Inglaterra', 1969, 8, N'Aparecidos en 1967, aunque la formación inicial nada tiene que ver con los miembros claves del grupo, Judas Priest, nombre derivado de un tema de Bob Dylan (“The Ballad of Frankie Lee and Judas Priest”), es una de las bandas más significativas del metal de finales de los 70 y comienzos de los 80, época dorada para las bandas heavy.  Con un término acuñado por primera vez por el escritor William Burroughs en su novela “The Soft Machine”, estas bandas de metal se desprendieron de la psicodelia que experimentó de manera extrema con los sonidos eléctricos a finales de los 60, ejemplificada en grupos como Cream, Blue Cheer o la Jimi Hendrix Experience, y se desgajaron también de la esencia blues-rock que destilaban los históricos grupos del hard rock, del que toman la base de su concepto sonoro, como Deep Purple, Led Zeppelin o Black Sabbath, influenciados a su vez por las pirotecnicas guitarreras de los citados Hendrix o Cream.  Los grupos autodenominados heavy metal fueron principalmente los aparecidos en la Gran Bretaña de finales de los 70 con Judas Priest como uno de sus nombres puntales. Amplificaron y endurecieron la instrumentación de sus ascendencias, en especial las guitarras, aceleraron el tempo, soliendo abordar tonos oscuros, provocadores, contestatarios en las letras, lo que suele ser caldo de cultivo para la atracción del adolescente urbano, y se significaban, como en el caso de Judas Priest, por singulares vestimentas. El origen de Judas Priest se encuentra a finales de los años 60 en plena época psicodélica, concretamente en 1967, cuando en la ciudad británica de Birmingham se creó un grupo formado por el cantante Al Atkins, quien bautizó a la banda con el citado tema de Dylan, su canción favorita, el guitarrista Ernie Chataway, el bajista Bruno Stapenhill y el batería John Partridge. El guitarra John Perry también participó en el sonido de esta primera etapa de Judas Priest, que transcurrió con más pena que gloria. En paralelo, dos amigos del colegio llamados Kenneth “K. K.” Downing (nacido el 27 de octubre de 1951), guitarra, y Ian Hill (nacido el 20 de enero de 1952), bajista, habían creado en 1969 un grupo al que denominaron Freight, en el que también se encontraba el batería John Ellis.  Cuando Downing, tras el fiasco de Judas Priest, invitó a Atkins en 1970 a que cantase con su grupo, Al les recomendó que Freight se rebautizaran con el nombre de su antigua banda: Judas Priest. En su contexto sonoro y derivados del blues-rock y la psicodelia más acerada triunfaban bandas hard rock y progresivas, sonidos que Judas Priest, con influencias de Led Zeppelin o Black Sabbath, adoptaron en sus inicios. Los comienzos de los años 70 son bastante inestables para Judas Priest, que cambió con asiduidad de miembros. Así, en 1973, se produjeron salidas y entradas muy importantes para el devenir del grupo. Atkins abandonó a sus compañeros y se planteó el dilema del nuevo vocalista. En Birmingham existía una banda llamada Hiroshima en la que cantaba Rob Halford (nacido el 25 de agosto de 1951), cuya hermana, llamada Sue, era novia del bajista Ian Hill. Ian recomendó al grupo a Halford y éste se incorporó a los Judas Priest, trayendo consigo también al batería de su antigua banda, John Finch, quien sustituyó a Kongo Campbell, quien, al igual que Al Atkins, había decidido dejar el grupo, que, al estilo de Thin Lizzy, decidió incorporar a otro guitarrista líder. K. K. Downing se acordó de Tipton, el miembro de los Flying Hat Band, y Glenn se unió a la banda para grabar en el mes de agosto de 1974 un single debut en el sello Gull, el pegadizo “Rocka Rolla”, que presenta en la cara b el tema “Never Satisfied”. A partir de acá la banda tomó un nuevo rumbo con grandes éxitos y Judas Priest fueron reconocidos como los padres del heavy metal, esto fue en grandes rasgos gracias al mítico cantante Rob Halford, leyenda del heavy y del metal en general. Halford tuvo una ida y vuelta a Judas (cuando comenzó a destapar su homosexualidad), pasó por una etapa solista la cual no resultó muy buena hasta que regresó con Judas al ver la aceptación de la gente para con él. Hasta el día de hoy siguen activos y esta banda selló el reconocido género del heavy metal.')
GO
